import ReactDOM from "react-dom/client";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import Header from "./header.js";
import "./index.css";

// ROUTES
import Home from "./home.js";
import About from "./about.js";

import Inventory from "./inventory.js";
import Financing from "./financing.js";
import TradeIn from "./trade-in.js";
import PayOnline from "./pay-online.js";
import ContactUs from "./contact-us.js";

function App() {
  return (
    <BrowserRouter>
      <Header />
      {/* <main> */}
      <Routes>
        <Route path="/home" element={<Home className="route" />}></Route>
        <Route path="/aboutus" element={<About className="route" />}></Route>
        <Route
          path="/inventory"
          element={<Inventory className="route" />}
        ></Route>
        <Route
          path="/financing"
          element={<Financing className="route" />}
        ></Route>
        <Route path="/tradein" element={<TradeIn className="route" />}></Route>
        <Route
          path="/payonline"
          element={<PayOnline className="route" />}
        ></Route>
        <Route
          path="/contact"
          element={<ContactUs className="route" />}
        ></Route>
      </Routes>
      {/* </main> */}
    </BrowserRouter>

    // <BrowserRouter
  );
}

export default App;
